import React from 'react'
import PropTypes from "prop-types"
import { Input, InputNumber, Button } from 'antd'
import './Home.css'

export default class Home extends React.Component {
    static propTypes = {
        getUser: PropTypes.func,
    }

    constructor() {
        super()
        this.state = {
            currentValue: '',
        }
    }

    render() {
        const { getUser } = this.props
        return (
            <React.Fragment>
                <Input 
                    onKeyPress={(event) => event.key === 'Enter' ? this.props.getUser(this.state.currentValue) : this.setState({currentValue: event.target.value})}
                    className='search-box'
                />
            </React.Fragment>
        )
    }
}
